<div class="box-body">
    <p style="text-align:justify;text-indent:40px;">Veristore Tools juga memiliki fitur Laporan Verifikasi. Fitur ini hanya dapat diakses oleh Administrator, Laporan Verifikasi memiliki fungsi  untuk mengetahui data verifikasi yang dilakukan oleh Administrator atau Operator di Veristore Tools.</p>
    <p style="text-align:justify;text-indent:40px;">Setelah sukses melakukan Verifikasi CSI maka data CSI akan tersimpan dan dapat dilihat di Laporan Verifikasi, user diwajibkan mengisi beberapa data sebelum dapat mencari data CSI:</p>
    <ol style="text-align:justify;">
        <li>Start Date (wajib)</li>
        <li>End Date  (wajib)</li>
        <li>CSI</li>
        <li>Serial Number</li>
        <li>Tipe EDC</li>
        <li>Versi App</li>
        <li>Teknisi</li>
        <li>TMS Operator</li>
        <li>Verification Operator</li>
    </ol>
    <p style="text-align:justify;text-indent:40px;">User dapat mencari data CSI cukup dengan memasukan Start Date dan End Date saja maka, data akan menampilkan semua data diwaktu tersebut. Untuk lebih spesifik user diharapkan mengisi semua data.</p>
    <ol style="text-align:justify;">
        <li>Pada halaman home Veristore silahkan pilih Laporan Verifikasi </li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Pada halaman Laporan Verifikasi user cukup memasukan Start date dan End date, lalu tekan tombol cari</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Maka sistem akan menampilkan semua data yang ada di waktu tersebut</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>User juga dapat eksport laporan dalam bentuk PDF, CSV, Excel 95 dan Excel 2007</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
    </ol>
</div>
